import logo from './logo.svg';
import './App.css';
import MyButton from './component/MyButton'
import TextAnimation from './component/text_animation'

function App() {
  return (
    <div className="App">
      <div class="content">
      <h3 class="header-text">สมัครอนุสโมสร </h3>
      <h3 class="header-text">คณะศิลปศาสตร์และวิทยาศาสตร์</h3><br></br>
      <TextAnimation/>
      <MyButton/>
      </div>
    </div>
  );
}

export default App;
